import React, { Component } from 'react';
import { Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';

export default class Example extends React.Component {
    constructor(props) {
      super(props);

      this.toggle = this.toggle.bind(this);
      this.state = {
        isOpen: false
      };
    }
    toggle() {
      this.setState({
        isOpen: !this.state.isOpen
      });
    }



  render() {

  // Styles
  const logoHead = {
    margin:'',
    background:'grey',
    padding:'15px 10px 20px 20px'
  }
  const logoWord = {
    fontSize:'40px',
    marginLeft:'50px'
  }
  const littleNav = {
    background:'blue',
    textAlign:'center',
    display: 'flex',
    justifyContent: 'space-between',
    color:'white',
    paddingTop:'20px',
    paddingBottom:'20px',


  }



    return (
      <div>
        <div style={logoHead}>
        <h3 style={logoWord}>Logo Here</h3>

        </div>
        <div >
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">reactstrap</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/components/">Components</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="https://github.com/reactstrap/reactstrap">GitHub</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Options
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Option 1
                  </DropdownItem>
                  <DropdownItem>
                    Option 2
                  </DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>
                    Reset
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
         <nav style={littleNav}>

            <div>Page 1</div>
            <div>Page 1</div>
            <div>Page 1</div>
            <div>Page 1</div>
            <div>Page 1</div>

        </nav>
        </div>



      </div>
    );
  }
}
